Job Description:
SUMMARY
Generally responsible for obtaining client’s accurate health and substance abuse history, performing physical assessments of clients undergoing detoxification, performing accurate vital signs, and proficient in making medications available to all clients, being able to diagnose patient conditions using examinations and tests, prescribing treatment and medications to attempt to heal any illnesses or injuries.
ESSESNTIAL FUNCTIONS
· Obtains health history and substance abuse history by interviewing client and/or family member;
· Is able to perform an accurate health assessment for all new detoxification clients;

Acton Medical Associates, like many other healthcare facilities, is experiencing an acute nursing shortage during the pandemic. We are looking for newly graduated Nurse Practitioners to support our clinical departments by performing various assignments, such as:
· NP triage of complex medical conditions (includes telehealth visits, describing/interpreting test results, ordering new medications and reviewing side effect profiles);
· Point of care testing and specimen collection (including COVID-19 testing, flu testing, strep testing);
· Vital sign collection and assessment;
· Immunization administration;

